import Article from "../Portal";

const Rules_Overview = () => {
  return (
    <>
      <section className="text-center pagecenter">
        <h3 className="title mb-10">
          <span className="mac-bg">قوانین منشور امپراتوری</span>
        </h3>
        <p>
          با تیم کار کشته ی امپراتوری کد آشنا شو! البته که اینا عکسای خودمون
          نیستن :)
        </p>
        <Article />
        <div className="grid grid-cols-4"></div>
      </section>
    </>
  );
};

export default Rules_Overview;
